// Step1.js
import React from "react";

const Step1 = ({ formData, handleChange }) => {
  return (
    <div className="step">
      <div className="form-group">
        <label>Toilet Name</label>
        <input
          type="text"
          name="toiletName"
          value={formData.toiletName}
          onChange={handleChange}
          required
        />
      </div>
    </div>
  );
};

export default Step1;
